Starring
Jenna Presley, Kagney Linn Karter, Kortney Kane, Tasha Reign, Baylee


Nurse Kagney has to deal with a bitchy wife who blames her husband for his lack of sex drive. But Kagney knows best how to cure that. When a hardened criminal is brought in for a final check-up before going to the big house, Nurse Kortney gives him a final taste of freedom. It's Nurse Jenna's first day at the hospital. So she gets the royal tour by the head surgeon. Most importantly: The Relaxation Room. When a patient comes in complaining of insomnia, he can't help hallucinate that Nurse Baylee is seriously coming onto him. Nurse Tasha might not have the best track record. So when a lawyer comes around asking questions, she needs to up the charm!
